  null,\n\t\"notes\": \" n        This impact evaluation uses random assignment at
  the village level to estimate impacts of the NECS and IMAGINE programs on enrollment,
  attendance, learning and other education outcomes.  Wave 1 data were collected in
  fall 2013.  Follow-up data was delayed and will be collected in spring 2016. nnThe
  EGRA descriptive study will measure reading skill of students enrolled in CI or
  CP and attending school on the day of data collection in a sample of NECS intervention
  schools.  Round 1 data were collected in spring 2014. No follow up data will be
  collected.n      \",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
